import "./App.css";
import React, { Component } from "react";

export default class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="App">
        <div>Caro Collazo</div>
        <img src="../public/name.png" width="549" alt="" class="logo-image" />
        <a
          href="/"
          aria-current="page"
          class="logo-link w-nav-brand w--current"
          aria-label="home"
        >

        </a>
        <div>Navigation</div>
        <div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      </div>
    );
  }
}
